import { stroykaApi } from '../stroyka.api';

const injectedBrands = stroykaApi.injectEndpoints({
    endpoints: (builder) => ({
        getBrands: builder.query<any, void>({
            query: () => ({
                url: `brands/`,
            }),
        }),

    }),
    overrideExisting: false,
})

export const {
    useGetBrandsQuery
} = injectedBrands;
